class CoconutSplatGame:
    def __init__(self, syllables: int, players: int):
        self.syllables = syllables
        self.players = players
        self.hands = [i for i in range(1, self.players + 1)]

    def start_game(self) -> int:
        while len(self.hands) > 1:
            self.hands = self.count_out(self.hands)
        return self.hands[0]

    def count_out(self, hands: list) -> list:
        for i in range(self.syllables):
            hands = self.touch_hands(hands)
        return hands

    def touch_hands(self, hands: list) -> list:
        start_index = 0
        for i in range(len(hands)):
            hands[(start_index + i) % len(hands)] = self.touch_hand(hands[(start_index + i) % len(hands)], hands)
        return hands

    def touch_hand(self, current_hand: int, hands: list) -> int:
        index = (hands.index(current_hand) + 1) % len(hands)
        return hands[index]

